Takeaways: An event loop is a loop that polls for an event. When an event is received, some code is run. The code is the event_handler. The application provides the event_handler. Native: The application controls the event loop ‚Äì winit. WASM: The browser controls the event loop, but consistent API is still exposed by winit. Github issue(s): amethyst#2191 Event loop example winit: // Not real code
impl EventLoop { pub fn run<F>(self, event_handler: F) -> ! where F: .. { loop { let event = poll_event(); // Blocks until an event arrives. event_handler(event, ..); } }
} amethyst: // Not real code, but close ü§è.
let event_handler = move |event, _, control_flow| { match event { // tick the game Event::MainEventsCleared => self.run_game_logic(), // input Event::DeviceEvent(device_event) => self.notify_input(device_event), _ => {}, }
}; event_loop.run(event_handler); // Never reached, as EventLoop::run(_) returns `!`. loop { let event = poll_event(); // Blocks until an event arrives. event_handler(event, ..);
}

