In a browser, the event loop is not controlled by winit, but the browser . To surrender control to the browser, winit sends the event handler to the browser, and panics . The Window::requestAnimationFrame API is used to receive events. Javascript callback example // While `pixel_shift`` is less than 100, call `requestAnimationFrame`.
var pixel_shift = 0; function move(_timestamp) { element.style.transform = 'translateX(' + pixel_shift + 'px)'; if (pixel_shift < 100) { pixel_shift += 1; window.requestAnimationFrame(move); }
} window.requestAnimationFrame(move); To ensure requestAnimationFrame is called, in the event handler, the control_flow parameter must be set to ControlFlow::Poll. let event_handler = move |event, _, control_flow| { // .. // Ensure the browser calls `requestAnimationFrame` // This will ensure this event handler is run, even if no events arrive. *control_flow = ControlFlow::Poll;
}; event_loop.run(event_handler);
